import Item from "./Item";

const ItemList = ({prodes}) => {
 
  return (
    <div className="d-flex CardsCont">
      {prodes.length > 0 ? prodes.map((prod) => <Item prods={prod}/>) : <p>Cargando....</p>}
    </div>
  );
};

export default ItemList;
